import React from "react";

function TaskTable(props) {
   return (
      <table className='task-table-container'>
         <tr>
            <th>Task</th>
            <th>Category</th>
            <th>Client</th>
            <th>Duration</th>
         </tr>
         {props.tasks.forEach((task) => {
            return;
            <h1>{task.taskTitle}</h1>;
         })}
      </table>
   );
}

export default TaskTable;
